import { Box } from "@mui/system";
import React from "react";
import { useStyles } from "./BodyStyle";
import DashboardIcon from "@mui/icons-material/Dashboard";
import DeveloperModeIcon from "@mui/icons-material/DeveloperMode";
import AcUnitIcon from "@mui/icons-material/AcUnit";
import GifIcon from "@mui/icons-material/Gif";
import { Container, Grid, Hidden } from "@material-ui/core";
import Image from "../../images/aboutSide.jpg";
import {
  Decorator,
  Divider,
  CardMedia,
  RenderSectionHeading,
} from "../common/Common";

const AboutUs = () => {
  const cardMediaData = [
    {
      title: " Web Development",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <DashboardIcon />,
    },
    {
      title: "Graphic Design",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <GifIcon />,
    },
    {
      title: "Mobile Apps",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <DeveloperModeIcon />,
    },
    {
      title: "Marketing",
      description: "Lorem ipsum dolor sit amet Consectetur adipisicing elit.",
      icon: <AcUnitIcon />,
    },
  ];
  const classes = useStyles();
  return (
    <Box className={classes.section}>
      <Container>
        <Grid container spacing={1}>
          <Grid item sm={5}>
            <Box xsDown component={Hidden}>
              <img
                src={Image}
                alt="about us"
                className={classes.responsiveImg}
              />
            </Box>
          </Grid>
          <Grid xs={12} sm={7}>
            {RenderSectionHeading({
              smallText: "ABOUT ME",
              heading: "Hello, I'm Huseyin",
              description:
                " A self taught developer who loves to codes something that wiil impact majority of the people in good way!",
            })}
            <br />
            <Grid container>
              {cardMediaData.map((item, i) => (
                <Grid xs={12} sm={6} key={i}>
                  {CardMedia({
                    label: item.title,
                    Desc: item.description,
                    Icon: item.icon,
                  })}
                </Grid>
              ))}
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default AboutUs;
